(defn score-event-type
  "Takes an event type (String) and returns a number score (Number)."
  [t]
  (let [event-score-map {
                         "PushEvent" 5
                         "PullRequestReviewCommentEvent" 4
                         "WatchEvent" 3
                         "CreateEvent" 2
                        }
        score (get event-score-map t 1)]
    score
    ))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;rentpath-scoring-service/score-event-type</span>","value":"#'rentpath-scoring-service/score-event-type"}
;; <=

;; @@
(testing "Score Event Type"
         (testing "PushEvent"
                  (is (= 5 (score-event-type "PushEvent"))))
         (testing "PullRequestReviewCommentEvent"
                  (is (= 4 (score-event-type "PullRequestReviewCommentEvent"))))
         (testing "WatchEvent"
                  (is (= 3 (score-event-type "WatchEvent"))))
         (testing "CreateEvent"
                  (is (= 2 (score-event-type "CreateEvent"))))
         (testing "AnyThingElseEvent"
                  (is (= 1 (score-event-type "AnyThingElseEvent"))))
         )
