(->> (gitapi/events)
     (map (juxt (comp :login :actor) 
                (comp score-event-type :type)))
     (group-by first)
     (map (juxt key
                (comp #(reduce + %) #(map second %) val)))
     (sort-by second)
     reverse
     table-view
     )
